script: |
  super -f text -I q6669.spq | sort > q6669.out

inputs:
  - name: q6669.spq
    data: |
      SELECT DISTINCT - col2, + col1 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col0 * 45 / col1 * - + col0 + + - 26 + - col1 * - - col0 BETWEEN + col1 AND NULL;
  - name: tab2

outputs:
  - name: q6669.out
    data: |
      -23	51
      -40	77
      -58	67
